import React from "react";

export const BarChartLabel = data => {
  const {  x, y } = data;
  console.log(data.datum)
  return (
    <svg>
      <text fontSize="25" x={x + 300} y={y + 7}>
        {data.datum.number}
      </text>

    </svg>
  );
};
